import cT from "./create-tile";

const initializeBoard = (): any => {
  return [
    [
      cT(false, ["a", 1]),
      cT(true, ["a", 1]),
      cT(false, ["a", 1]),
      cT(true, ["a", 1]),
      cT(false, ["a", 1]),
      cT(true, ["a", 1]),
      cT(false, ["a", 1]),
      cT(true, ["a", 1])
    ],
    [
      cT(true, ["a", 1]),
      cT(false, ["a", 1]),
      cT(true, ["a", 1]),
      cT(false, ["a", 1]),
      cT(true, ["a", 1]),
      cT(false, ["a", 1]),
      cT(true, ["a", 1]),
      cT(false, ["a", 1])
    ],
  ]
};

export default initializeBoard;
